description:
Galna MTV-stjarnan TOM GREEN passerar an en gang gransen for vad som ar 
passande. Han ar sa osmaklig att FREDDY GOT FINGERED blivit komedin som 
bara maste ses! Allt ar mojligt nar serietecknaren Brody lamnar sina foraldrars 
trygga kallare for att sla sig fram i Hollywood och traffa sin dromtjej, en 
rullstolsbunden nymfoman. Med &quot;...nagra av de roligaste scenerna nagonsin&quot; 
(Seattle Times), - och sa manga anledningar att kanna avsky - ar det inte 
konstigt att folk inte kan sluta prata om FREDDY GOT FINGERED. 

Med Eddie Kaye, Tom Green, Marisa Coughlan m fl. 
